import React from 'react';
import logo from '../logo.svg';
import "../App.css"
import data from "../Constants/data.json"
const words = ['sky', 'blue', 'falcon', 'wood', 'cloud'];
// const products = require("../Constants/data.json")
function Products() {


    return (

        <div className="App">
            <h1>Amazing Recipes</h1>
            <div class="shadow">
                <div class="container">

                    {data.map((item, index) => (
                        <div class="card">
                            <div className="imgContainer">
                                <img className="img" src={item.imageURL} id="voicebutton" />
                            </div>
                            <h3>{item.name}</h3>
                            <div className="detailsContainer">
                            <h5>{item.steps[0]}</h5>
                            </div>
                        </div>
                    ))}
                </div>
            </div>
        </div>

    );
}

export default Products;
